            }
        }

        static bool IsTriangle(int side1, int side2, int side3)
        {
            if (side1 + side2 <= side3)
                return false;
            if (side1 + side3 <= side2)
                return false;
            if (side2 + side3 <= side1)
                return false;
            return true;
        }
    }
